import styled from "styled-components";

export const PictureContainer = styled.div`
  padding: 15px;
`

export const Picture = styled.div`
  background-image: url("images/lq_1.jpg");
  background-position: center;
  background-size: cover;
  border-radius: 100%;
  height: 150px;
  width: 150px;
  margin: 0 auto;
`;
